import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Link, Routes, useNavigate } from "react-router-dom";

const InfoComponent = () => {
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const [url, setUrl] = useState('');
  const [browserName, setBrowserName] = useState('');
  const [browserVersion, setBrowserVersion] = useState('');
  const [os, setOS] = useState('');

  useEffect(() => {
    const d = new Date();
    let day = d.getDate();
    let month = d.getMonth() + 1;
    let year = d.getFullYear();
    setDate(`Data curenta: ${day}/${month}/${year}`);

    let hour = d.getHours();
    let minutes = d.getMinutes();
    setTime(`Ora curenta: ${hour}:${minutes}`);

    setUrl(`Adresa URL: ${window.location.href}`);
    setBrowserName(`Numele browser-ului: ${navigator.appName}`);
    setBrowserVersion(`Versiunea browser-ului: ${navigator.appVersion}`);
    setOS(`Sistemul de operare folosit: ${navigator.platform}`);
  }, []);

  return (
    <div>
      <p>{date}</p>
      <p>{time}</p>
      <p>{url}</p>
      <p>{browserName}</p>
      <p>{browserVersion}</p>
      <p>{os}</p>
    </div>
  );
};

const App = () => {
    return (
        <Router>
          <div>
            <h1>Users</h1>

            <div>
              <Link to="/login"><button>Log in</button></Link>
              <Link to="/signin"><button>Sign in</button></Link>
            </div>
            <Routes>
              <Route path="/login">
                <Login />
              </Route>
              <Route path="/signin">
                <SignIn />
              </Route>
            </Routes>
          </div>
        </Router>
      );
  };

  const Login = () => {
    const navigate = useNavigate();

    const handleSubmit = (e) => {
      e.preventDefault();
      // Logica de autentificare (de exemplu, verificarea datelor introduse)

      // Dacă autentificarea este reușită, se va face redirecționarea
      navigate('/buttons');
    };

    return (
      <div>
        <h2>Login</h2>
        <form onSubmit={handleSubmit}>
          {/* Inputurile pentru datele de autentificare */}
          <input type="text" placeholder="Nume" />
          <input type="text" placeholder="Prenume" />
          <input type="email" placeholder="Email" />
          <input type="password" placeholder="Parola" />
          <button type="submit">Submit</button>
        </form>
      </div>
    );
  };


  const SignIn = () => {
    // Component pentru procesul de înregistrare (Sign in)
    return (
      <div>
        <h2>Sign in</h2>
        {/* Formular pentru înregistrare */}
      </div>
    );
  };
export default App;
